import React, {Component} from 'react';
import styles from './LeftBottomBox.module.css';


class LeftBottomBox extends Component{

  constructor(props){
    super(props);

    this.state = {
      cssClass: styles.leftBottom,
      moved: false
    }
  }

  onLeftBottomClicked = () => {
    let classes = [styles.leftBottom];
    debugger;
    let newClass = this.state.moved ? classes.push("moved").join(" ") : styles.leftBottom;
    this.setState((prevState,props) => ({
                                          cssClass: newClass,
                                          moved: !prevState.moved
                                        }));
  }

  render(){
    return (
        <div className={this.state.styleClass} onClick={this.onLeftBottomClicked}/>
    );
  }
}

export default LeftBottomBox;
